import React from 'react';
import { Link } from 'react-router-dom';

const MainHeader = () => {
    return (
        <header>
            <nav>
                <ul>
                    <li>
                        <Link href="welcome">Welcome</Link>
                    </li>
                    <li>
                        <Link href="/products">Products</Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
};

export default MainHeader;
